import React from 'react';

const carModal = (props) => {
    let showModal = (
        <Aux>
            <div className={classes.carModal}>
                {props.children}
            </div>
        </Aux>
    )

    if (!props.showModal){
        showModal = null;
    }

    return (
        <Aux>
            {showModal}
        </Aux>
    )

}

export default carModal;
